import { useEffect, useState } from "react";
import { createFileRoute, Navigate } from "@tanstack/react-router";
import {
  useQuery,
  useSuspenseQuery,
  useQueryClient,
} from "@tanstack/react-query";
import { Command as CommandPrimitive } from "cmdk";
import { Loader2, X } from "lucide-react";

import {
  searchGames,
  type GameSearchResult,
  type GameLogEntry,
} from "@/server/games";
import { GameLogDialog } from "@/components/GameLogDialog";
import { PageHeader } from "@/components/page-header";
import {
  Command,
  CommandGroup,
  CommandItem,
  CommandList,
} from "@/components/ui/command";
import { cn } from "@/lib/utils";
import { logsQueryOptions } from "@/lib/queries";

export const Route = createFileRoute("/")({
  component: HomePage,
  loader: ({ context }) =>
    context.queryClient.ensureQueryData(logsQueryOptions),
  errorComponent: () => <Navigate to="/login" />,
});

function HomePage() {
  const queryClient = useQueryClient();

  const [query, setQuery] = useState("");
  const [debouncedQuery, setDebouncedQuery] = useState("");

  const [selectedGame, setSelectedGame] = useState<
    GameSearchResult | GameLogEntry | null
  >(null);
  const [isDialogOpen, setIsDialogOpen] = useState(false);

  // Debounce search input to avoid firing a query on every keystroke
  useEffect(() => {
    const trimmed = query.trim();
    const timer = setTimeout(() => setDebouncedQuery(trimmed), 300);
    return () => clearTimeout(timer);
  }, [query]);

  const canSearch = debouncedQuery.length >= 2;

  const logsQuery = useSuspenseQuery(logsQueryOptions);

  const searchQuery = useQuery({
    queryKey: ["searchGames", debouncedQuery],
    queryFn: ({ signal }) =>
      searchGames({ data: { query: debouncedQuery }, signal }),
    enabled: canSearch,
    staleTime: 1000 * 60 * 3,
  });

  const handleSelectGame = (game: GameSearchResult | GameLogEntry) => {
    setSelectedGame(game);
    setIsDialogOpen(true);
  };

  const handleSave = () => {
    setQuery("");
    queryClient.invalidateQueries({ queryKey: ["gameLogs"] });
  };

  return (
    <div className="flex flex-col min-h-[calc(100vh-8rem)]">
      <div className="grid grid-cols-12 gap-4 overflow-x-hidden">
        {/* Hero Section */}
        <PageHeader
          title="Log Entry"
          subtitle="System Ready"
          className="col-span-12"
        >
          <div className="text-right hidden sm:block">
            <span className="text-xs uppercase tracking-widest text-muted-foreground">
              Input Required
            </span>
          </div>
        </PageHeader>
      </div>

      <div className="grid grid-cols-12 gap-4 flex-1 min-h-0">
        <div className="col-span-12 flex-1 flex flex-col min-h-0">
          <Command
            shouldFilter={false}
            className="bg-transparent h-full flex flex-col"
          >
            <div className="flex items-baseline gap-4 border-b border-border pb-4 group focus-within:border-foreground transition-colors">
              <CommandPrimitive.Input
                placeholder="SEARCH DATABASE..."
                value={query}
                onValueChange={setQuery}
                className="flex-1 bg-transparent text-xl sm:text-3xl font-medium placeholder:text-muted-foreground outline-none tracking-tight uppercase w-full text-foreground"
              />
              {query.length > 0 && (
                <button onClick={() => setQuery("")} className="outline-none">
                  <X className="w-5 h-5 text-muted-foreground hover:text-foreground transition-colors" />
                </button>
              )}
              {searchQuery.isFetching && (
                <Loader2 className="w-5 h-5 animate-spin text-foreground" />
              )}
            </div>

            {query.length >= 2 ? (
              <CommandList
                className={cn(
                  "mt-8 flex-1 max-h-none h-full",
                  (searchQuery.data?.length ?? 0) > 0 || query.length >= 2
                    ? "block"
                    : "hidden"
                )}
              >
                {(searchQuery.data?.length ?? 0) === 0 &&
                  query.length >= 2 &&
                  !searchQuery.isFetching && (
                    <div className="py-8 border-t border-border">
                      <p className="font-mono text-xs text-muted-foreground">
                        ERROR: NO_MATCH_FOUND
                      </p>
                    </div>
                  )}

                <CommandGroup>
                  {searchQuery.data?.map((game) => (
                    <CommandItem
                      key={game.id}
                      value={game.id + game.name}
                      onSelect={() => handleSelectGame(game)}
                      className="group flex items-center gap-4 sm:gap-8 py-6 border-b border-border cursor-pointer data-[selected=true]:bg-muted/30 transition-colors rounded-none px-4 -mx-4"
                    >
                      <div className="w-12 sm:w-16 aspect-[3/4] bg-muted shrink-0 transition-all overflow-hidden">
                        {game.coverUrl ? (
                          <img
                            src={game.coverUrl}
                            alt=""
                            className="w-full h-full object-cover transition-all duration-300 group-hover:scale-110 group-hover:brightness-110"
                          />
                        ) : (
                          <div className="w-full h-full flex items-center justify-center text-[10px] font-mono text-muted-foreground">
                            N/A
                          </div>
                        )}
                      </div>
                      <div className="flex-1 min-w-0">
                        <div className="flex flex-col sm:flex-row sm:items-baseline gap-1 sm:gap-4">
                          <span className="text-lg sm:text-xl font-bold uppercase tracking-tight group-hover:text-primary transition-colors truncate block text-foreground">
                            {game.name}
                          </span>
                          <span className="font-mono text-xs text-muted-foreground group-hover:text-foreground shrink-0">
                            {game.releaseYear || "----"}
                          </span>
                        </div>
                      </div>
                    </CommandItem>
                  ))}
                </CommandGroup>
              </CommandList>
            ) : (logsQuery.data.logs.length ?? 0) > 0 ? (
              <div className="mt-8">
                <div className="mb-4">
                  <p className="font-mono text-xs text-muted-foreground uppercase tracking-widest">
                    Recent Entries
                  </p>
                </div>
                <div className="grid grid-cols-4 sm:grid-cols-6 md:grid-cols-8 gap-3 sm:gap-4">
                  {logsQuery.data.logs.slice(0, 8).map((entry) => (
                    <button
                      key={entry.id}
                      onClick={() => handleSelectGame(entry)}
                      className="group aspect-[2/3] bg-muted transition-all cursor-pointer overflow-hidden relative"
                    >
                      {entry.coverUrl ? (
                        <img
                          src={entry.coverUrl}
                          alt={entry.name || ""}
                          className="w-full h-full object-cover transition-all duration-300 group-hover:scale-110 group-hover:brightness-110"
                        />
                      ) : (
                        <div className="w-full h-full flex items-center justify-center text-[8px] font-mono text-muted-foreground">
                          N/A
                        </div>
                      )}
                      <div className="absolute inset-0 bg-gradient-to-b from-transparent via-primary/20 to-transparent -translate-y-full group-hover:animate-scan pointer-events-none" />
                    </button>
                  ))}
                </div>
              </div>
            ) : null}
          </Command>
        </div>
      </div>

      {/* Game Log Dialog */}
      <GameLogDialog
        open={isDialogOpen}
        onOpenChange={setIsDialogOpen}
        game={selectedGame}
        onSave={handleSave}
      />
    </div>
  );
}

