const { chromium } = require('playwright');

const TARGET_URL = 'http://localhost:3000';

// Generate unique credentials
const timestamp = Date.now();
const uniqueEmail = `testuser_${timestamp}@secure-mail.com`;
const securePassword = `SecureP@ss${timestamp}!`; // Strong password with special chars

// Games to add
const gamesToAdd = ['Mario', 'Zelda', 'Metroid', 'Halo', 'Pokemon'];

(async () => {
  const browser = await chromium.launch({ headless: false, slowMo: 100 });
  const page = await browser.newPage();

  try {
    console.log('='.repeat(60));
    console.log('GAME TRACKER AUTOMATION TEST');
    console.log('='.repeat(60));
    console.log(`\nCredentials being used:`);
    console.log(`  Email: ${uniqueEmail}`);
    console.log(`  Password: ${securePassword}`);
    console.log('');

    // Step 1: Navigate to login page
    console.log('\n[STEP 1] Navigating to login page...');
    await page.goto(`${TARGET_URL}/login`);
    await page.waitForLoadState('networkidle');
    console.log('‚úÖ Login page loaded');

    // Step 2: Click on Register tab
    console.log('\n[STEP 2] Clicking Register tab...');
    await page.click('button:has-text("Register")');
    await page.waitForTimeout(500);
    console.log('‚úÖ Register tab clicked');

    // Step 3: Fill in registration form
    console.log('\n[STEP 3] Filling registration form...');
    await page.fill('input[type="email"]', uniqueEmail);
    await page.fill('input[type="password"]', securePassword);
    console.log('‚úÖ Form filled');

    // Step 4: Submit registration
    console.log('\n[STEP 4] Submitting registration...');
    await page.click('button[type="submit"]');

    // Wait for success message or redirect
    await page.waitForTimeout(2000);

    // Check for success message
    const successMessage = await page.locator('text=Account created').isVisible().catch(() => false);
    if (successMessage) {
      console.log('‚úÖ Account created successfully!');
    }

    // Wait for redirect to home page
    await page.waitForURL('**/', { timeout: 10000 }).catch(() => {});
    console.log('‚úÖ Redirected after registration');

    // Take screenshot of home page
    await page.screenshot({ path: '/tmp/01-home-after-registration.png', fullPage: true });
    console.log('üì∏ Screenshot saved: /tmp/01-home-after-registration.png');

    // Step 5: Add 5 games with rating 9
    console.log('\n[STEP 5] Adding 5 games with rating 9...');

    for (let i = 0; i < gamesToAdd.length; i++) {
      const gameName = gamesToAdd[i];
      console.log(`\n  Adding game ${i + 1}/5: "${gameName}"...`);

      // Make sure we're on the home page
      await page.goto(TARGET_URL);
      await page.waitForLoadState('networkidle');

      // Search for the game
      const searchInput = page.locator('input[placeholder="SEARCH DATABASE..."]');
      await searchInput.fill(gameName);
      console.log(`    - Searching for "${gameName}"...`);

      // Wait for search results
      await page.waitForTimeout(1500); // Wait for debounce + API response

      // Click on the first result
      const firstResult = page.locator('[cmdk-item]').first();
      const resultVisible = await firstResult.isVisible().catch(() => false);

      if (resultVisible) {
        await firstResult.click();
        console.log(`    - Clicked on search result`);

        // Wait for dialog to open
        await page.waitForSelector('[role="dialog"]', { timeout: 5000 });
        console.log(`    - Dialog opened`);

        // Set rating to 9 using the slider
        // The slider has min=0, max=10, so we need to click at the right position
        const slider = page.locator('[role="slider"]');

        // Get slider bounds
        const sliderBounds = await slider.boundingBox();
        if (sliderBounds) {
          // Calculate position for rating 9 (9/10 = 90% of width)
          const targetX = sliderBounds.x + (sliderBounds.width * 0.9);
          const targetY = sliderBounds.y + (sliderBounds.height / 2);

          // Click to set the value
          await page.mouse.click(targetX, targetY);
